  and wireless digital networks, electronic data and information, IT devices and systems,
  and software applications?today provides indispensable infrastructure for activities
  across all facets of society. Throughout the IT revolution, the United States has
  led the world in the invention and applications of these technologies. Ongoing research
  and development R and D to provide advanced IT capabilities for Federal missions
  has fueled the creation of new ideas, and innovations addressing key national priorities,
  including national security, national defense, economic prosperity, scientific discovery,
  energy and environment, health, individual privacy, and quality of life...\",\n\t\"license_title\":
